import React from 'react';
import { Row } from 'reactstrap';
import './../assets/scss/custom/_body.scss'
import MinhasCotacoes from './MinhasCotacoes';
const Body = () => {
    return(
        <div className="body">
            <div style={{
                display: 'flex',
                flexDirection: 'row',
                overflowX: 'hidden',
            }}>
                <MinhasCotacoes/>
            </div>
        </div>
    )
}

export default Body;
